import React from 'react';
import './App.css';
import Row from './Row';
import requests from './request';

function App() {
  return (
    <div className="App">

     <Row title="NETFLIX ORIGINALS" fetchUrl={requests.fetchNetflixOriginals} />
     <Row title="EM ALTA AGORA" fetchUrl={requests.fetchEmAlta} />
    </div>
  );
}

export default App;
